import Portfolio from "./Portfolio";
import About from "./About";
import "react-router-dom";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function Nav() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/portfolio">
            <Portfolio />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default Nav;
